import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

export default function App() {

    return (
        <Router>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/about" element={<About />} />
            </Routes>
        </Router>
    );
}

function Home() {
    return <h1>Home</h1>;
}

function About() {
    return <h1>About</h1>;
}
